import React from 'react';
import { NavLink } from 'react-router-dom';
import s from './header.module.css';

const Header = () => {
    return(
        <header className={s.header}> 
        {/* <img src='#' alt='logo'/> */}
        <div className={ s.loginBlock }>
          <NavLink></NavLink>
        </div>
      </header>
    )
};

export default Header;
